import React, { Component } from "react";

class Home extends Component {
  render() {
    return (
      <div id="homeSection">
        <div id="welcome">
          <h2>Hi, I'm Charlie...</h2>
          <p>
            A software developer straight of university looking for a job
          </p>
        </div>

        <div id="homeImage">

        </div>
      </div>
    );
  }
}

export default Home;
